// HasSubnet applies the HasEdge predicate on the "subnet" edge.
func HasSubnet() predicate.IpScanJob {
	return predicate.IpScanJob(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, SubnetTable, SubnetColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSubnetWith applies the HasEdge predicate on the "subnet" edge with a given conditions (other predicates).
func HasSubnetWith(preds ...predicate.Subnet) predicate.IpScanJob {
	return predicate.IpScanJob(func(s *sql.Selector) {
		step := newSubnetStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.IpScanJob) predicate.IpScanJob {
	return predicate.IpScanJob(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.IpScanJob) predicate.IpScanJob {
	return predicate.IpScanJob(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.IpScanJob) predicate.IpScanJob {
	return predicate.IpScanJob(sql.NotPredicates(p))
}
